import React from 'react'

export class Todo extends React.Component {

    constructor(props) {
        super(props);
        this.getKey = this.getKey.bind(this);
    }

    getKey() {
        this.props.deleteTodo(this.props.id)
    }

    render() {
        return (
            <div>
                <h4>{this.props.todo}</h4>
                <button onClick={this.getKey} >Del</button>
            </div>
        )
    }
 }
